//	validatin for the Write Complaint form. it check other category,brand and contact person.
	//and also check for the country ,state ,city others field 
	public ActionErrors validate(ActionMapping mapping, HttpServletRequest req)
	{
		ActionErrors errors = super.validate(mapping,req);
		//check for other category , brand and contact person
		
		
		//end of category check
		if(this.checkDealer.equalsIgnoreCase("checked"))
		{
			if(this.dealerName.length()==0)
			{
				errors.add("stdModifyDraftForm",new ActionError("errors.required","Dealer Name"));
			}
			if(this.address.length()==0)
			{
				errors.add("stdModifyDraftForm",new ActionError("errors.required","Dealer Address"));
			}
			if(this.country.equals("0~+0"))
			{
				errors.add("stdModifyDraftForm",new ActionError("errors.required","Dealer Country"));
			}
			if(this.state.equals("0"))
			{
				errors.add("stdModifyDraftForm",new ActionError("errors.required","Dealer State"));
			}
			if(this.city.equals("0"))
			{
				errors.add("stdModifyDraftForm",new ActionError("errors.required","Dealer City"));
			}
			if(this.country.equals("-1~+0") && this.otherCountry.length()<=0)
			{
				errors.add("stdModifyDraftForm",new ActionError("errors.resource.other","country"));
				if(this.otherState.length()<=0)
				{
					errors.add("stdModifyDraftForm",new ActionError("errors.resource.other","state"));
					if(this.otherCity.length()<=0)
					{
						errors.add("stdModifyDraftForm",new ActionError("errors.resource.other","city"));
					}
				}
			}
			else
			{
				if(this.state.equals("-1") && this.otherState.length()<=0)
				{
					errors.add("stdModifyDraftForm",new ActionError("errors.resource.other","state"));
					if(this.otherCity.length()<=0)
					{
						errors.add("stdModifyDraftForm",new ActionError("errors.resource.other","city"));
					}
				}
				else
				{
					if(this.city.equals("-1") && this.otherCity.length()<=0)
					{
						errors.add("stdModifyDraftForm",new ActionError("errors.resource.other","city"));
					}
				}
				
			}
		
		}
		Vector<String> unnamedDataVec = new Vector<String>();
		for(int i=1; i<=35; i++)
		{
			if(req.getParameterValues("field"+i)!= null)
			{
				String arrTemp[] = req.getParameterValues("field"+i);
				String strTemp="";
				for(int j=0; j<arrTemp.length; j++)
				{
					strTemp=(strTemp.equalsIgnoreCase("")) ? arrTemp[j] : strTemp+", "+arrTemp[j];
					////System.out.println("Field "+i+" values "+arrTemp[j]);
				}
				String strValue = req.getParameter("fieldmnd"+i);
				String strFldName = req.getParameter("fldname"+i);
				////System.out.println("strValue "+i+" "+strValue);
				if(strValue.trim().equalsIgnoreCase("1"))
				{
					////System.out.println("strTemp.trim() "+i+" " + strTemp.trim());
					////System.out.println("strTemp.trim().length() "+i+" "+strTemp.trim().length());
					if(i<11)
					{
						if(Integer.parseInt(strTemp.trim())<=0)
						{
							errors.add("stdModifyDraftForm",new ActionError("errors.required",strFldName));
						}
					}
					else
					{
						if(strTemp.trim().length()<=0)
						{
							errors.add("stdModifyDraftForm",new ActionError("errors.required",strFldName));
						}
					}
				}
				unnamedDataVec.add(strTemp);
			}
			else
			{
				unnamedDataVec.add("");
			}
		}
		HttpSession session = req.getSession();
		session.setAttribute("cid", this.country);
		session.setAttribute("sid", this.state);
		session.setAttribute("pid", this.city);
		session.setAttribute("complaintUnnamedData",unnamedDataVec);
		session.setAttribute("catid", this.category);
		session.setAttribute("otherCatid", (this.otherCategory.equalsIgnoreCase("")) ? "NullNone" : this.otherCategory.toString().trim());
		session.setAttribute("Bid", this.brand);
		session.setAttribute("otherBid", (this.otherBrand.equalsIgnoreCase("")) ? "NullNone" : this.otherBrand.toString());
		//System.out.println("qtypeqtypeqtype on form qtype"+this.qtype);
		//System.out.println("qtypeqtypeqtype on form qtype"+qtype);
		return errors;
	}
	
	//end of validatin methd
	
	
	
